import { userDataAction } from '../reducers/userStore';
const errorList = [];
export const setUserAction = (data) => {
  return async (dispatch) => {
    try {
      if (Object.keys(data).length) {
        if (data.email === '') {
          errorList.a
        } else {
          dispatch(userDataAction.setLoginError([]));
        }
        dispatch(
          userDataAction.setLoginError([
            { errorType: 'errorText', message: 'errorText' },
            { errorType: 'normalText', message: 'normalText' },
            { errorType: 'goodText', message: 'goodText' },
          ])
        );
      }
    } catch (error) {
      console.error('hi-808: ', error);
      return error;
    }
  };
};
